package WeekOfCode30;
import java.io.*;
import java.util.*;
import java.text.*;
import java.math.*;
import java.util.regex.*;

class Check implements Comparator<Query>{
	@Override
	public int compare(Query q1,Query q2){
		if(q1.x < q2.x){
			return 1;
		}else if(q1.x > q2.x){
			return -1;
		}else{
			int q1Range = q1.right - q1.left;
			int q2Range = q2.right - q2.left;
			if(q1Range < q2Range){
				return 1;
			}else if(q1Range > q2Range){
				return -1;
			}else{
				return 0;
			}
		}
	}
}
class Range{
	int left;
	public Range(int left, int right) {
		this.left = left;
		this.right = right;
	}
	int right;
}
class Query {
	int left; 
	int right;
	int x;
	int y;
	
	public Query(int left, int right, int x, int y){
		this.left = left;
		this.right = right;
		this.x = x;
		this.y = y;
	}

	@Override
	public int hashCode() {
		final int prime = 31;
		int result = 1;
		result = prime * result + left;
		result = prime * result + right;
		result = prime * result + x;
		result = prime * result + y;
		return result;
	}

	@Override
	public boolean equals(Object obj) {
		if (this == obj)
			return true;
		if (obj == null)
			return false;
		if (getClass() != obj.getClass())
			return false;
		Query other = (Query) obj;
		if (left != other.left)
			return false;
		if (right != other.right)
			return false;
		if (x != other.x)
			return false;
		if (y != other.y)
			return false;
		return true;
	}
	
}
public class Solution3 {
	static HashMap<String, TreeMap<Integer,Integer> > mimoization;
	static HashMap<String, Range> highRange;
	static HashMap<Query, Integer> performedQuery;
	static int[] a;
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        int n = in.nextInt();
        int q = in.nextInt();
        a = new int[n];
        for(int a_i=0; a_i < n; a_i++){
            a[a_i] = in.nextInt();
        }
        PriorityQueue<Query> frontier = new PriorityQueue<Query>(10,new Check());
        Query[] querys = new Query[q];
        performedQuery = new HashMap<Query,Integer>();
        for(int a0 = 0; a0 < q; a0++){
            int left = in.nextInt();
            int right = in.nextInt();
            int x = in.nextInt();
            int y = in.nextInt();
            querys[a0] = new Query(left, right, x, y);
            frontier.add(querys[a0]);
        }
        mimoization = new HashMap<String, TreeMap<Integer,Integer> >();
        highRange = new HashMap<String, Range>(); 
        while(!frontier.isEmpty()){
        	Query current = frontier.poll();
        	if(!performedQuery.containsKey(current)){
        	String xY = current.x +"+"+ current.y;
        	if(mimoization.containsKey(xY)){
        		Range range = highRange.get(xY);
        		if(range == null){
        			System.out.println(current);
        		}
        		if(current.left >= range.left &&  current.right <= range.right ){
    				TreeMap<Integer,Integer> rangeMap = mimoization.get(xY);
                    performedQuery.put(current,rangeMap != null ? rangeMap.subMap(current.left, current.right+1).size() : 0);
        		}else{
        			int start=0;
        			int end=0;
        			if(current.left < range.left && current.right >= range.left){
        				start = current.left;
    					end = range.left;
        				performQuery(current,xY,true,start,end,current.left,range.right);
        			}else if(current.right > range.right && current.left <= range.right){
        				start = range.right;
    					end = current.right;
        				performQuery(current,xY,true,start,end,range.left,current.right);
        			}else{
        				performQuery(current,xY,false,current.left,current.right,current.left,current.right);
        			}
        			TreeMap<Integer,Integer> rangeMap = mimoization.get(xY);
                    performedQuery.put(current,rangeMap != null ? rangeMap.subMap(current.left, current.right+1).size() : 0);
        		}
        	}
        	else{
        		if(xY.equals("993+170")){
        			System.out.println();
        		}
        		performQuery(current,xY,true,current.left,current.right,current.left,current.right);
                TreeMap<Integer,Integer> rangeMap = mimoization.get(xY);
                performedQuery.put(current,rangeMap != null ? rangeMap.subMap(current.left, current.right+1).size() : 0);
        	}
        }
        }
        for(Query eachQuery: querys){
        	System.out.println(performedQuery.get(eachQuery));
        }
        in.close();
    }
    public static void performQuery(Query current, String xY, boolean updateHighestRange, int start, int end,int rangeStart, int rangeEnd){
    	for(int i=start; i <= end; i++){
    		if(i >=0 && i < a.length){
	        	int newY = a[i] % current.x;
	            if(a[i] % current.x == current.y ){
	            	if(!mimoization.containsKey(xY)){
	            		TreeMap<Integer,Integer> rangeMap = new TreeMap<>();
	            		rangeMap.put(i, 1);
	            		mimoization.put(xY, rangeMap);
	            	}else{
	        		TreeMap<Integer,Integer> rangeMap = mimoization.get(xY);
	        		rangeMap.put(i, 1);
	            	mimoization.put(xY, rangeMap);
	            	}
	            }else{
	            	String newXy = current.x + "+" + newY;
	            	if(!mimoization.containsKey(newXy)){
	            		TreeMap<Integer,Integer> rangeMap = new TreeMap<>();
	            		rangeMap.put(i, 1);
	            		if(updateHighestRange){
	                		highRange.put(newXy, new Range(rangeStart,rangeEnd));            		
	            		}
	            		mimoization.put(newXy, rangeMap);
	            	}else{
	        		TreeMap<Integer,Integer> rangeMap = mimoization.get(newXy);
	            	rangeMap.put(i,1);
	            	if(updateHighestRange){
	            		highRange.put(newXy, new Range(rangeStart,rangeEnd));            		
	        		}
	            	mimoization.put(newXy, rangeMap);
	            	}
	            }
	        }
    	}
    	if(updateHighestRange){
    		highRange.put(xY, new Range(rangeStart,rangeEnd));
		}
    }
}

